import React from 'react';
import { Card, Image } from 'semantic-ui-react';
import { withRouter } from 'react-router';

const DoctorCard = (props) => {
  const { id, name, photos, formatted_address, rating } = props.doctor;

  return (
    <Card onClick={(e) => props.history.push(`/doctors/${id}`)}>
      <Card.Content>
        <Card.Header>{name}</Card.Header>
      </Card.Content>
      {photos && <Image alt='' src={photos[0] ? photos[0].slug : ''}></Image>}
      <Card.Content>
        <strong>Address: </strong>
        {formatted_address}
        <Card.Meta></Card.Meta>
        {rating && <strong>Rating: {rating}</strong>}
      </Card.Content>
    </Card>
  );
};

export default withRouter(DoctorCard);
